// src/pages/History.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Card, Button, Collapse, Modal } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function History() {
  const [records, setRecords] = useState([]);
  const [openCollapse, setOpenCollapse] = useState({});
  const [showConfirmModal, setShowConfirmModal] = useState(false);
  const [recordToDelete, setRecordToDelete] = useState(null);



  useEffect(() => {
    const fetchRecords = async () => {
      // 获取历史记录数据的逻辑
      try {
        const response = await axios.get('http://localhost:8000/api/history');
        if (Array.isArray(response.data)) {
          setRecords(response.data.map(record => ({...record, open: false})));
        } else {
          console.log('Response data is not an array:', response.data);
        }
      } catch (error) {
        console.error('Error fetching history:', error);
      }
    };

    fetchRecords();
  }, []);

  const handleToggleCollapse = index => {
    setOpenCollapse(prevState => ({...prevState, [index]: !prevState[index]}));
  };


  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:8000/api/delete/${id}`);
      setRecords(records.filter(record => record.id !== id));
    } catch (error) {
      console.error('Error deleting record:', error);
    }
  };



  const handleConfirmDelete = () => {
    if (recordToDelete) {
      handleDelete(recordToDelete.id);
    }
    setShowConfirmModal(false);
  };


  const handleShare = (record) => {
    // 实现分享逻辑
    console.log("Sharing", record);
  };


  const handleAddToReview = (record) => {
    // 实现添加到复习计划逻辑
    console.log("Adding to review plan", record);
  };

  return (
    <div>
      <h2>练习记录</h2>
      {records.map((record, index) => (
        <Card  key={record.id} style={{ margin: '10px 0' }}>
          <Card.Header>
            <strong>时间:</strong> {new Date(record.created_at).toLocaleString()}
            <Button variant="link" onClick={() => handleToggleCollapse(index)}>
              {openCollapse[index] ? '隐藏详情' : '显示详情'}
            </Button>
          </Card.Header>
          <Collapse in={openCollapse[index]}>
            <div>
              <Card.Body>
                <Card.Title>问题: {record.question}</Card.Title>
                <Card.Text>
                  <strong>回答:</strong> {record.answer}
                  <br />
                  <strong>评价:</strong> {record.content}
                </Card.Text>
                <Button variant="danger" onClick={() => {
                    setRecordToDelete(record);
                    setShowConfirmModal(true);
                  }}>删除</Button>
                <Button variant="primary" onClick={() => handleShare(record)}>分享</Button>
                <Button variant="info" onClick={() => handleAddToReview(record)}>加入复习计划</Button>
              </Card.Body>
            </div>
          </Collapse>
        </Card>


      ))}
      {/* 删除确认对话框 */}
      <Modal show={showConfirmModal} onHide={() => setShowConfirmModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>确认删除</Modal.Title>
        </Modal.Header>
        <Modal.Body>确定要删除这条记录吗？此操作无法撤销。</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowConfirmModal(false)}>取消</Button>
          <Button variant="danger" onClick={handleConfirmDelete}>删除</Button>
        </Modal.Footer>
      </Modal>
    </div>

  );
}

export default History;
